from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message




@dataclass
class Date(_Message):

    # Год
    year: uint16_t
    # месяц
    month: uint8_t
    # день месяца
    day: uint8_t


class DateDict(TypedDict):

    # Год
    year: Union[uint16_t, int ]

    # месяц
    month: Union[uint8_t, int ]

    # день месяца
    day: Union[uint8_t, int ]

